window.bookSummaryJSON = "Oil prices are surging to record highs. A new dictator is rising in Iraq. China is threatening Taiwan. North Korean forces are ready to strike south. Israel is feverishly trying to complete the Third Temple.... <p>And in the midst of a world ready to explode, American president James MacPherson's second term is ending. The battle to succeed him is heating up into the most fiercely contested presidential election in American history. Who will lead a bitterly divided country over the next four years? And just what role - if any - does the U.S. play in history's last days?</p> <p>As the presidential campaign narrows into a dead heat, the Secret Service learns of a catastrophic terrorist plot to assassinate one of the candidates - but which one? Who do they want dead? And can U.S. forces stop the terrorists before millions lose their lives?</p>"; 
